import { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Paper, 
  Table, 
  TableBody, 
  TableCell, 
  TableContainer, 
  TableHead, 
  TableRow,
  IconButton,
  Button,
  Fab,
  Alert
} from '@mui/material';
import { 
  Edit as EditIcon, 
  Delete as DeleteIcon,
  Add as AddIcon 
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { getCars, deleteCar } from '../services/api';

function CarList() {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    loadCars();
  }, []);

  const loadCars = async () => {
    try {
      setLoading(true);
      setError('');
      const data = await getCars();
      setCars(data);
    } catch (error) {
      console.error('Error al cargar los coches:', error);
      setError('Error al cargar los coches. Por favor, intente de nuevo.');
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    if (window.confirm('¿Está seguro de que desea eliminar este coche?')) {
      try {
        await deleteCar(id);
        loadCars();
      } catch (error) {
        console.error('Error al eliminar el coche:', error);
      }
    }
  };

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', p: 3 }}>
        <Typography>Cargando coches...</Typography>
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ p: 3 }}>
        <Alert severity="error">{error}</Alert>
      </Box>
    );
  }

  return (
    <Box sx={{ p: 3 }}>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4">Lista de Coches</Typography>
        <Button
          variant="contained"
          startIcon={<AddIcon />}
          onClick={() => navigate('/cars/new')}
        >
          Nuevo Coche
        </Button>
      </Box>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Matrícula</TableCell>
              <TableCell>Modelo</TableCell>
              <TableCell>Color</TableCell>
              <TableCell>Nivel de Gasolina</TableCell>
              <TableCell>Acciones</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {cars.map((car) => (
              <TableRow key={car.id}>
                <TableCell>{car.matricula}</TableCell>
                <TableCell>{car.modelo}</TableCell>
                <TableCell>
                  <Box sx={{ 
                    width: 40, 
                    height: 40, 
                    backgroundColor: car.color,
                    border: '1px solid #ccc',
                    borderRadius: 1
                  }} />
                </TableCell>
                <TableCell>{car.nivelGasolina}</TableCell>
                <TableCell>
                  <IconButton 
                    onClick={() => navigate(`/cars/edit/${car.id}`)}
                    color="primary"
                  >
                    <EditIcon />
                  </IconButton>
                  <IconButton 
                    onClick={() => handleDelete(car.id)}
                    color="error"
                  >
                    <DeleteIcon />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}

export default CarList;
